describe("[React] MoleculePreviewFile", () => {
  function noOp() {}

  if (typeof window.URL.createObjectURL === "undefined") {
    Object.defineProperty(window.URL, "createObjectURL", { value: noOp });
  }

  it("Renders the component", () => {
    const props: IPreviewFileProps = {
      fileSrc: "",
      placeholder: "test",
      onChange: () => jest.fn(),
      placeholderProps: {
        size: "medium",
      },
    };

    const component = render(<MoleculePreviewFile {...props} />);

    expect(component).toBeTruthy();
  });

  it("Renders the component (no file)", () => {
    const props: IPreviewFileProps = {
      placeholder: "",
      placeholderProps: {
        size: "medium",
      },
    };

    const component = render(<MoleculePreviewFile {...props} />);

    expect(component).toBeTruthy();
  });

  it("Add fileSrc prop", () => {
    const mockChange = jest.fn();
    const props: IPreviewFileProps = {
      fileSrc:
        "https://images.unsplash.com/photo-1655389530462-f01e44cfccb5?ixlib=rb-1.2.1&ixid=MnwxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8&auto=format&fit=crop&w=987&q=80",
      placeholder: "test",
      onChange: mockChange,
      placeholderProps: {
        size: "medium",
      },
    };

    const component = render(<MoleculePreviewFile {...props} />);

    const inputFile = document.getElementsByTagName("input")[0] as HTMLElement;

    fireEvent.change(inputFile, { target: { files: fileList } });

    expect(mockChange).toHaveBeenCalledTimes(1);
  });

  it("Add fileSrc prop", () => {
    const mockChange = jest.fn();
    const props: IPreviewFileProps = {
      fileSrc:
        "https://images.unsplash.com/photo-1655389530462-f01e44cfccb5?ixlib=rb-1.2.1&ixid=MnwxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8&auto=format&fit=crop&w=987&q=80",
      placeholder: "test",
      onChange: mockChange,
      placeholderProps: {
        size: "medium",
      },
    };

    const component = render(<MoleculePreviewFile {...props} />);

    const inputFile = document.getElementsByTagName("input")[0] as HTMLElement;

    fireEvent.change(inputFile, { target: { files: [] } });

    expect(component).toBeTruthy();
  });

  it("Open the file dialog", () => {
    const props: IPreviewFileProps = {
      fileSrc: "",
      placeholder: "test",
      accept: "image/png, image/jpeg",
      onChange: () => jest.fn(),
      placeholderProps: {
        size: "medium",
      },
    };

    const component = render(<MoleculePreviewFile {...props} />);

    const openFileDiv = document.getElementsByClassName(
      "open-files"
    )[0] as HTMLDivElement;
    fireEvent.click(openFileDiv);

    expect(component).toBeTruthy();
  });

  it("Add file and remove it", () => {
    const mockChange = jest.fn();
    const props: IPreviewFileProps = {
      fileSrc:
        "https://images.unsplash.com/photo-1655389530462-f01e44cfccb5?ixlib=rb-1.2.1&ixid=MnwxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8&auto=format&fit=crop&w=987&q=80",
      placeholder: "test",
      accept: "image/png, image/jpeg",
      onChange: mockChange,
      placeholderProps: {
        size: "medium",
      },
    };

    const component = render(<MoleculePreviewFile {...props} />);

    const inputFile = document.getElementsByTagName("input")[0] as HTMLElement;

    fireEvent.change(inputFile, { target: { files: fileList } });

    const removeFileIcon = document.getElementsByClassName(
      "remove-file"
    )[0] as HTMLElement;
    fireEvent.click(removeFileIcon);

    expect(mockChange).toHaveBeenCalledTimes(1);
  });
});
